import React, { useEffect, useState } from "react";
import { getSalesHistoryKream } from "./getSalesHistoryKream";

const LayOutSalesHistoryKream = ({ submitCode }) => {
    const [data, setData] = useState([]);
    console.log(typeof submitCode)
    useEffect(
        () => {
            const fetchApi = async () => {
                const response = await getSalesHistoryKream(submitCode)
                setData(response)
                console.log(data)
            }
            fetchApi()
        }, [submitCode]
    )
    return (
        <>
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Size</th>
                            <th>Price</th>
                            <th>Date</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            data.map(
                                item => {
                                    <tr>
                                        <td>item.size</td>
                                        <td></td>
                                        <td></td>
                                    </tr>
                                }
                            )
                        }
                    </tbody>
                </table>
            </div>
        </>
    )
}

export default LayOutSalesHistoryKream
